            "Story": "在那黎明照拂的圣城，织者抚弄金丝，连缀命运。<br>背负「浪漫」火种的黄金裔，召集世间英雄，带领他们再度踏上漫长的征程<br>——击落众神，归还神火，予以几近覆灭的翁法罗斯新生。"
