            "_id": 3,
            "Story": "时光荏苒，她设计的服饰已如星空那般浩繁。<br>不知为何，那华美广大的衣橱内，却保存着许多褴褛不堪的旧衣布片。<br><br>充斥纷争的大地上，年轻的将士们穿着鲜亮的衣裳出征，归来时战服已成殓衣，甚至只能带回衣裳的一角。无人认领的时候，只有她会将这些布片收集起来。<br>她也曾在愤怒中毁去华服，那些腐朽堕落、养尊处优的贵族不配穿上她织就的衣裳招摇过市——即使她自己也曾是这番模样。<br>还有…那一件又一件小小的衣装。<br><br>在过往的时光里，她们伴她成长，同她诉说往日与未来的歌谣<br>——见证诸多丑恶之后，她才明白，那些稚嫩话语中的分量。<br><i>「身为奥赫玛的改衣师，墨涅塔的祭司，我与你们有着相同的职责。」<br>「但救世要付出的代价……」<br>「…就像你们一样？」<br>「就像*我们*一样。」</i><br><br>最显眼的地方，悬挂着朴素简洁的祭司长裙。她时常拿出清洗扫尘，只为不忘自己向那神明许下的诺言。<br><i>「请原谅我，为了人世间最美的作品……」</i><br>很久以前，握住火种的那一刻，她突然在黑暗中「看见」了一幅从未见过的美丽景象——<br>在那黄金般的未来里，再也没有纷争，也再没有死亡。"
